import React, { Component } from 'react';
import logo from '../log.jpg';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Navbar, Nav, NavItem } from 'reactstrap';
import './Header.css';

class Header extends Component {
  render() {
    return (
      <Navbar default collapseOnSelect>
        <Navbar.Header>
          <Navbar.Brand>
            <Link to="/">CodeLife</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
        </Navbar.Header>
        <Navbar.Collapse>
          <Nav pullRight>
            <NavItem eventKey={1} componentClass={Link} href="/" to="/">
              Home
            </NavItem>
            <NavItem eventKey={2} componentClass={Link} href="/posts" to="/posts">
              Explore
            </NavItem>
            <NavItem eventKey={3} componentClass={Link} href="/donation" to="/donation">
              Donate
            </NavItem>
            <NavItem eventKey={4} componentClass={Link} href="/" to="/">
              About
            </NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    )
  }
}

export default Header;
